if(!window.RSFilterAccordion)var RSFilterAccordion=function(n){var i=$("#"+n),o=i.find(".card");i.find("#"+n+"_accordion").on("shown.bs.collapse",function(){var n=i.find(".collapse.in").closest(".panel");window.location.hash=n.data("code")}),i.find("[data-filter]").on("click",function(n){n.preventDefault();var i=$(this).data("filter");o.show(),i&&o.not('[data-type="'+i+'"]').hide()})};